import React, {Component} from 'react';
import './App.css';
import TodoItem from './components/TodoItem';

class App extends Component {

  constructor() {
    super();
    this.listItem = [
      {task: 'Giặt quần áo', isComplete},
      {task: 'Quét nhà'},
      {task: 'Học ReactJs'}
    ];
  }
  render () {  
  return (
    <div className="App">    
      {
       this.listItem.map((item) => 
        <TodoItem item={item} />
       )
      }

    </div>
  );
  }
}

export default App;
